const SocialLink = ({ id, href, icon, linkClass }) => {
  return (
    <li key={id}>
      <a href={href} target='_blank' rel='noreferrer' className={linkClass}>
        <i className={icon}></i>
      </a>
    </li>
  );
};
export default SocialLink;
